$(document).ready(function(){
  $('#notifications').on("click", function() {
    var read_at = Date($.now());
    var notification_ids = $('#notification').val();
    $('.badgeAlert').remove();
    var data =  jQuery.map(notification_ids, function(value, notification_ids){
      return [value];
    });
    alert(data);
    $.ajax({
      type: 'GET',
      url: '/notifications',
      data: {data: data}
    });
  })
})
